import React from "react";
import "../Alumni/alumni.css";
import image from "../../images/academic.jpg";

function Alumni(){
    return(
        <>
            <div className="academics-headimage">
                <img src={image} alt="blog" width="100%" height="100%"/>
            </div>

            
        </>
    )
}
export default Alumni;
